import React from 'react'

const OnSaleItemsList = (props) => {

  return (

    <div className='onSaleItems'>
      {
      props.onSaleItems.map((items, idx) => (
        <>
        <div key={idx}>{items.name}</div>
        <div key={idx}>{items.img}</div>
        <div key={idx}>{items.condition}</div>
        <div key={idx}>{items.negotiable}</div>
        <div key={idx}>{items.price}</div>
        <div key={idx}>{items.seller}</div>
        <div key={idx}>{items.sold}</div>
        </>

      ))
    }
    </div>
  )
}

export default OnSaleItemsList
